import React, {Component} from 'react';
import { Col, Container, Row } from 'react-bootstrap';

class Nav extends Component {
  render(){
    return(
        <nav>

            <Row className="top">
              <Col>
                <h6>Top</h6>
              </Col>
            </Row>
            <Row className="bottom">
              <Container>
                <Col>
                  <h6>Bottom</h6>
                </Col>
              </Container>
            </Row>

        </nav>
    )
}
}


export default Nav;
